import React, { useState } from 'react';

function SignUpForm() {
    const [email, setEmail] = useState('');
    const [emailError, setEmailError] = useState('');
    const [password, setPassword] = useState('');
    const [passwordError, setPasswordError] = useState('');
    const [showPlans, setShowPlans] = useState(false);

    const validateEmail = (email) => {
        const re = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return email.length >= 5 && email.length <= 50 && re.test(email);
    };

    const handleEmailChange = (e) => {
        setEmail(e.target.value);
        if (e.target.value.trim() === '') {
            setEmailError('Este campo es obligatorio');
        } else if (!validateEmail(e.target.value)) {
            setEmailError('Introduce una dirección de correo electrónico válida');
        } else {
            setEmailError('');
        }
    };

    const handlePasswordChange = (e) => {
        setPassword(e.target.value);
        const passwordLength = e.target.value.length;
        if (passwordLength < 6 || passwordLength > 60) {
            setPasswordError('La contraseña debe tener entre 6 y 60 caracteres');
        } else {
            setPasswordError('');
        }
        e.target.title = `${passwordLength} caracteres`;
    };

    const handleSiguienteClick = () => {
        if (email.trim() === '') {
            setEmailError('Este campo es obligatorio');
        } else if (!validateEmail(email)) {
            setEmailError('Introduce una dirección de correo electrónico válida');
        } else if (password.trim() === '') {
            setPasswordError('Este campo es obligatorio');
        } else if (password.length < 6) {
            setPasswordError('La contraseña debe tener entre 6 y 60 caracteres');
        } else {
            setPasswordError('');
            setShowPlans(true);
        }
    };

    return (
        <div>
            {!showPlans ? (

<>
<div>
<label htmlFor="email">Correo electrónico:</label>
<input type="email" id="email" name="email" value={email} onChange={handleEmailChange} />
{emailError && <span>{emailError}</span>}
</div>
<div>
<label htmlFor="password">Contraseña:</label>
<input type="password" id="password" name="password" value={password} onChange={handlePasswordChange} />
{passwordError && <span>{passwordError}</span>}
</div>
<button onClick={handleSiguienteClick}>Siguiente</button>
</>
) : (
<>
<div>
<h2>Selecciona el plan ideal para ti</h2>
<ul>
<li>
<input type="checkbox" name="plan" id="plan1" />
<label htmlFor="plan1">Ve todo lo que quieras</label>
</li>
<li>
<input type="checkbox" name="plan" id="plan2" />
<label htmlFor="plan2">Recomendaciones exclusivas para ti</label>
</li>
<li>
<input type="checkbox" name="plan" id="plan3" />
<label htmlFor="plan3">Cambia de plan o cancelalo cuando quieras</label>
</li>
</ul>
</div>
<div>
<h2>Planes</h2>
<div className="plans">
<div className="plan">
<h3>Básico con Anuncios</h3>
<p className="price">5,49€</p>
<p className="quality">Buena</p>
<p className="resolution">720p</p>
<p className="multidevice">-</p>
<p className="downloads">-</p>
</div>
<div className="plan">
<h3>Estándar</h3>
<p className="price">12,99€</p>
<p className="quality">Muy buena</p>
<p className="resolution">1080p</p>
<p className="multidevice">-</p>
<p className="downloads">-</p>
</div>
<div className="plan">
<h3>Premium</h3>
<p className="price">17,99€</p>
<p className="quality">Excepcional</p>
<p className="resolution">4K + HDR</p>
<p className="multidevice">✓</p>
<p className="downloads">✓</p>
</div>
</div>
<button>Siguiente</button>
</div>
</>
)}
</div>
);
}

export default SignUpForm;
